        body {
            margin: 0;
            padding: 0;
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
            background-color: #eef5f3;
            font-family: Arial, sans-serif;
            overflow: hidden;
        }

        .container {
            text-align: center;
            position: relative;
        }

        h1 {
            font-size: 48px;
            color: #333;
            margin-bottom: 40px;
            z-index: 1;
            position: relative;
        }

        .logos {
            margin-top: 20px;
        }

        .card {
            background-color: white;
            padding: 40px;
            margin-top: 30px;
            border-radius: 12px;
            box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
            display: inline-block;
            max-width: 900px;
            margin-bottom: 20px;
            /* added margin to create space between cards */
        }

        .card h2 {
            font-size: 24px;
            color: #333;
            margin-bottom: 15px;
        }

        .card ul {
            list-style: none;
            padding: 0;
            text-align: left;
        }

        .card ul li {
            background-color: #f9f9f9;
            padding: 10px;
            margin-bottom: 8px;
            border-radius: 8px;
            font-size: 18px;
            color: #555;
        }

        .floating {
            position: fixed;
            width: 150px;
            height: 150px;
            top: 20%;
            left: 20%;
            transform: translateX(-50%);
            filter: blur(8px);
            opacity: 0.3;
            animation: float 5s ease-in-out infinite;
        }

        svg {
            width: 150px;
            height: auto;
            position: relative;
            z-index: 2;
        }

        @keyframes float {
            0% {
                transform: translate(-50%, -20px);
            }

            50% {
                transform: translate(-50%, 20px);
            }

            100% {
                transform: translate(-50%, -20px);
            }
        }
    </style>
</head>

